class Product extends Component {
  render(){
	return (
	    <div className="App">
	      	<h1> {this.props.name} </h1>
	    	<h3> {this.props.age} </h3>
	    	<h4> {this.props.children}</h4>	
	    </div>
	);
  }
}

export default Product;
